angular.module("extension-registry").run(["$templateCache", function($templateCache) {$templateCache.put("__extension-link.html","<a ng-if=\"!item.fn\"\n   ng-href=\"{{item.link}}\"\n   target=\"{{item.target}}\"\n   title=\"{{item.displayName}}\"\n   class=\"extension-link extension-{{index}} {{item.className}}\">\n   {{item.displayName}}\n </a>\n\n<a ng-if=\"item.fn\"\n   ng-href=\"#\"\n   ng-click=\"item.fn(context)\"\n   title=\"{{item.displayName}}\"\n   class=\"extension-link extension-{{index}} {{item.className}}\">\n   {{item.displayName}}\n </a>\n");
$templateCache.put("__extension-output.html","<div class=\"extension-output extension-list\">\n  <div\n    ng-repeat=\"item in items track by $index\"\n    class=\"extension-repeater\">\n    <!-- todo: how to pass each item to the renderer -->\n    <extension-renderer\n      class=\"extension-renderer extension-item\"\n      item=\"item\"\n      index=\"$index\"\n      context=\"context\"></extension-renderer>\n  </div>\n</div>\n");
$templateCache.put("__extension-renderer.html","<div\n  ng-switch on=\"item.type\">\n  <div ng-switch-when=\"text\">\n    <div ng-include=\" \'__extension-text.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"link\">\n    <div ng-include=\" \'__extension-link.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"select\">\n    <div ng-include=\" \'__extension-select.html\' \"></div>\n  </div>\n  <div ng-switch-when=\"html\">\n    <div ng-include=\" \'__extension-html.html\' \"></div>\n  </div>\n</div>\n");
$templateCache.put("__extension-sanitize.html","<div\n  ng-bind-html=\"item.output\"\n  class=\"eextension-sanitize extension-html extension-{{index}} {{item.className}}\"></div>\n");
$templateCache.put("__extension-select.html","<select\n  name=\"select\"\n  class=\"extension-select extension-{{index}} {{item.className}}\">\n  <option\n    ng-repeat=\"option in item.options\"\n    value=\"{{option.value}}\"\n    class=\"extension-option extension-option-{{$index}} {{option.className}}\">\n    {{option.label}}\n  </option>\n</select>\n");
$templateCache.put("__extension-text.html","<div\n  class=\"extension-text extension-{{index}} {{item.className}}\">\n  <p>{{item.output}}</p>\n</div>\n");}]);